import React from "react";
import "./navbar.css";

const Navbar = () => {
  return (
    <section className="navBarSection">
      <header className="header flex">
        <div className="logoDDiv">
          <a href="#" className="logo">
            <h1>Travel.</h1>
          </a>
        </div>
      </header>
    </section>
  );
};

export default Navbar;
